    function findColleges(){

     var  district   = document.querySelector("#district").value ;
     var  university = document.querySelector("#university").value ;
     var  region     = document.querySelector("#region").value ;
     var  category   = document.querySelector("#category").value ;
     var  rank       = document.querySelector("#rank").value ;
     var  branch       = document.querySelector("#branch").value ;
     var  college_table  = document.querySelector("#college_table");
     if(rank==""){
       alert("PLease enter your rank");
     } if(category && category.trim()==""){
       alert("PLease select Category");
     } else {
 	 	var filteredList = allRanksList.filter(function(obj){
 	 	    
 	   		return (!!district ? obj["DIST"] == district : true ) &&

 	     		(!!region ? obj["REG"] == region : true ) &&
 	     		(!!branch ? obj["branch_code"] == branch : true ) &&
 	     		obj[category] >= parseInt(rank);
 		 });

 		 filteredList.sort(function(first, second){

 		 });
